import Link from "next/link";

const Header = () => (
  <>
    <div className="navbar">
      <Link href="/">
        <a className="logo">WooYoungChoi</a>
      </Link>
      <Link href="/">
        <a className="navlink">Home</a>
      </Link>
      <Link href="/about">
        <a className="navlink">About</a>
      </Link>
      <style jsx>
        {`
          .navbar {
            display: inline-block;
            padding: 10px 0 10px 0;
            border: solid;
          }

          .logo {
            font-family: "futura";
            font-size: 20px;
            font-weight: bold;
            color: #00ace6;
            text-decoration: none;
          }

          .navlink {
            display: inline-block;
            float: right;
            font-family: "Arial";
            margin-right: 15px;
            text-decoration: none;
          }

          .navlink:hover {
            opacity: 0.6;
          }
        `}
      </style>
    </div>
  </>
);

export default Header;
